  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123616 contains raw underway
  meteorological, time series, navigational, physical and optical data logged by the
  Scientific Computer System (SCS) aboard NOAA Ship Okeanos Explorer in the Gulf of
  Mexico and North Atlantic Ocean from 2014-02-24 to 2014-03-18. Office of Marine
  and Aviation Operations (OMAO) personnel aboard the ship submitted these data and
  associated metadata to NODC. In addition, NODC Accession 0123616 contains supplementary
  cruise-level metadata, which OMAO personnel logged in the Ship Daily Activity Log
  (SDAL). OMAO and NODC personnel developed the automated process to archive these
  data under the auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"license_title\":
